// var data = require('../data/nc.json')
const url = 'http://127.0.0.1:5000/get_grid'
export default function getGridNC() {
    var response = fetchData(url)
    console.log(response);
    return response
}

function fetchData(url) {
    const reqOptions ={
      method:"get", 
      headers:{"x-access-token": "test"},
    }
      let request = fetch(url, reqOptions);
      console.log('feching');
      // return request
      request
        .then(r => r.json())
        .then(data => {
          return data
        }, (error) => {
          console.error(error);
        });
  }
